package zakjo.studentsapp.model;public class Evualtion {    public String percentage;    public String created_at;    public String marks;    public String title;    public String t_name;    public String c_name;    public Evualtion() {}    public Evualtion(String percentage, String created_at, String marks, String title, String t_name, String c_name) {        this.percentage = percentage;        this.created_at = created_at;        this.marks = marks;        this.title = title;        this.t_name = t_name;        this.c_name = c_name;    }    public String getPercentage() {        return percentage;    }    public void setPercentage(String percentage) {        this.percentage = percentage;    }    public String getCreated_at() {        return created_at;    }    public void setCreated_at(String created_at) {        this.created_at = created_at;    }    public String getMarks() {        return marks;    }    public void setMarks(String marks) {        this.marks = marks;    }    public String getTitle() {        return title;    }    public void setTitle(String title) {        this.title = title;    }    public String getT_name() {        return t_name;    }    public void setT_name(String t_name) {        this.t_name = t_name;    }    public String getC_name() {        return c_name;    }    public void setC_name(String c_name) {        this.c_name = c_name;    }}